import React from "react";
import data from "../PeriodicDetails";

export default function Element({
  elementName,
  elementSymbol,
  elementNumber,
  element,
}) {
  return (
    <>
      <div
        className={`element ${elementName} ${elementPhase}`}
        style={{
          gridRow: data.elements[elementNumber - 1].ypos,
          gridColumn: data.elements[elementNumber - 1].xpos,
        }}
      >
        <div className="element__number">
          {data.elements[elementNumber - 1].number}
        </div>
        <div className="element__symbol">
          {data.elements[elementNumber - 1].symbol}
        </div>
        <div className="element__name">
          {data.elements[elementNumber - 1].name}
        </div>
        <div className="element__mass">
          {data.elements[elementNumber - 1].atomic_mass.toFixed(1)}
        </div>
      </div>
    </>
  );
}
